import pandas as pd
from bs4 import BeautifulSoup
from urllib.request import urlopen
import time

def school_link():
    school = pd.read_csv('rschool_info.csv')
    name = school['name']
    link = school['link']
    new_link_list = []
    for i in range(len(link)):
        school = {}
        new_link = link[i] + 'admissions'
        school['name'] = name[i]
        school['link'] = new_link
        # print(school)
        new_link_list.append(school)
    return new_link_list


def school_applications(new_link_list):
    final_list = []
    c = 0
    failed = []
    for dict in new_link_list:
        c += 1
        # print(c)
        # time.sleep(5)
        # if str(c)[-1] == '7':
        #     failed.append(dict['name'])
        #     continue

        # print(c)
        # print(c,':',dict)
        school_dic = {}
        name = dict['name']

        # if name in passlist:
        #     continue


        link = dict['link']
        html = urlopen(link)
        soup = BeautifulSoup(html, "lxml")

        admission = soup.find(id='admissions-statistics')
        rates = admission.findAll('span')
        rate_list = []
        for rate in rates:
            rate_list.append(rate.getText())
        # print(rate_list)
        Accept_rate_index = rate_list.index("Acceptance Rate")
        Total_Applicants = rate_list.index('Total Applicants')
        Sat_all = rate_list.index("SAT Range")
        Sat_read = rate_list.index("SAT Reading")
        Sat_math = rate_list.index("SAT Math")
        Sat_submit = rate_list.index("Students Submitting SAT")
        ACT_index = rate_list.index("ACT Range")
        Act_read = rate_list.index("ACT English")
        Act_math = rate_list.index("ACT Math")
        Act_write = rate_list.index("ACT Writing")
        Act_submit = rate_list.index("Students Submitting ACT")
        # Fee_index = rate_list.index("Application Fee")

        school_dic['name'] = name
        school_dic['link'] = link
        try:
            school_dic['Acceptance Rate'] = rate_list[Accept_rate_index + 1]
        except:
            school_dic['Acceptance Rate'] = ' '

        try:
            school_dic['Total_Applicants'] = rate_list[Total_Applicants+1]
        except:
            school_dic['Total_Applicants'] = ' '

        try:
            school_dic['SAT Range'] = rate_list[Sat_all + 1]
        except:
            school_dic['SAT Range'] = ' '

        try:
            school_dic['SAT Reading'] = rate_list[Sat_read+1]
        except:
            school_dic['SAT Reading'] = ' '

        try:
            school_dic['SAT Math'] = rate_list[Sat_math+1]
        except:
            school_dic['SAT Math'] = ' '

        try:
            school_dic['Students Submitting SAT'] = rate_list[Sat_submit + 1]
        except:
            school_dic['Students Submitting SAT'] = ' '

        try:
            school_dic['ACT Range'] = rate_list[ACT_index + 1]
        except:
            school_dic['ACT Range'] = ' '

        try:
            school_dic['ACT English'] = rate_list[Act_read+1]
        except:
            school_dic['ACT English'] = ' '

        try:
            school_dic['ACT Math'] = rate_list[Act_math + 1]
        except:
            school_dic['ACT Math'] = ' '

        try:
            school_dic['ACT Writing'] = rate_list[Act_write + 1]
        except:
            school_dic['ACT Writing'] = ' '

        try:
            school_dic['Students Submitting ACT'] = rate_list[Act_submit+1]
        except:
            school_dic['Students Submitting ACT'] = ' '
        print(school_dic)
        final_list.append(school_dic)

        # if c % 10 == 0:
        #     time.sleep(100)
        # else:
        #     continue
    # print(failed)
    return final_list


new_link_list = school_link()
a = school_applications(new_link_list)

header = ['name', 'link', 'Acceptance Rate','Total_Applicants','SAT Range','SAT Reading','SAT Math',
          'Students Submitting SAT','ACT Range','ACT English','ACT Math','ACT Writing','Students Submitting ACT']
table = pd.DataFrame(a, columns=header)
table.to_csv('test.csv')


